0420103, Раздел 1, Подраздел 1.1: если значение показателя "Размер вознаграждения за заключение, сопровождение, изменение, расторжение и исполнение договоров страхования, сострахования" по АП "Иные виды обязательного личного страхования, предусмотренные федеральными законами" ГАП "Виды страхования" больше нуля, то в пояснительной записке приводятся:
данные по указанному показателю в разрезе иных видов обязательного личного страхования (с указанием реквизитов федерального закона о конкретном виде обязательного личного страхования) в случае, если по указанному АП отражены данные по двум и более иным видам обязательного личного страхования;
либо реквизиты федерального закона о конкретном виде обязательного личного страхования в случае, если по указанному АП отражены данные по одному иному виду обязательного личного страхования. Контрольное соотношение также проверяет значения показателя по следующим АП: "Итого по типам вознаграждения", "От страхователей", "От страховых организаций" ГАП "Источник вознаграждения", а также "Физические лица", "Юридические лица", "Индивидуальные предприниматели" ГАП "Физические лица и юридические лица".

0420103, Раздел 1, Подраздел 1.1: если значение показателя "Размер вознаграждения за заключение, сопровождение, изменение, расторжение и исполнение договоров страхования, сострахования" по АП "Иные виды обязательного имущественного страхования, предусмотренные федеральными законами" ГАП "Виды страхования" больше нуля, то в пояснительной записке приводятся:
данные по указанному показателю в разрезе иных видов обязательного имущественного страхования (с указанием реквизитов федерального закона о конкретном виде обязательного имущественного страхования) в случае, если по указанному АП отражены данные по двум и более иным видам обязательного имущественного страхования;
либо реквизиты федерального закона о конкретном виде обязательного имущественного страхования в случае, если по указанному АП отражены данные по одному иному виду обязательного имущественного страхования. Контрольное соотношение также проверяет значения показателя по следующим АП: "Итого по типам вознаграждения", "От страхователей", "От страховых организаций" ГАП "Источник вознаграждения", а также "Физические лица", "Юридические лица", "Индивидуальные предприниматели" ГАП "Физические лица и юридические лица".
